import React from 'react';
import './Serveyou.css';
function Serveyou() {
  return (
    <>
      <section id="parallax-bg" class="parallax-one parallaxie" style="background-image: url(&quot;images/parallax1.jpeg&quot;); background-size: cover; background-repeat: no-repeat; background-attachment: fixed; background-position: center 53.28px;">
     <div class="container">
      <div class="row">
         <div class="col-md-12 text-center wow bounceIn">
            <p class="bottom10 whitecolor">We help you go online and have a proper online presence</p>
            <h1 class="bottom25 whitecolor font-light2">We Are Here To Serve You.</h1>
            <a href="contact-us.php" class="btn_common white_transparent">Get a Quote</a>
         </div>
      </div>
   </div>
</section>
    </>
  )
}

export default Serveyou
